// generate default export
export const svgs = {
    ng_bootstrap,
    ng_cancel,
    ng_check_circle,
    ng_chevron_right,
    ng_close,
    ng_devicon,
    ng_done,
    ng_emoji_events,
    ng_gfonts,
    ng_github_revert,
    ng_github,
    ng_help,
    ng_info,
    ng_node,
    ng_play_arrow,
    ng_sass,
    ng_svelte,
    ng_swiper,
    ng_tmdb,
    ng_volume_off,
    ng_volume_up,
};
export default svgs;

//watch dom for icons to add
const
    selector = 'i[class^="ng-"]',
    nodes = new Set(),
    watcher = (elem) => {
        return () => {
            for (let target of [...elem.querySelectorAll(selector)]) {

                if (nodes.has(target)) {
                    continue;
                }
                nodes.add(target);

                // creates the icon and remove the node
                const
                    id = target.className.split(' ')[0],
                    [, name] = names.find(item => item[0] === id) ?? ['', ''];


                if (name && svgs[name]) {
                    let size = target.getAttribute("size"), color = target.getAttribute("color");

                    svgs[name].insertBefore(target, size, color);
                }

                target.parentElement?.removeChild(target);
            }
        };
    };


export function watch(elem) {
    elem ??= document.body;
    const
        fn = watcher(elem),
        observer = new MutationObserver(fn);

    fn();
    observer.observe(elem, {
        attributes: true, childList: true, subtree: true
    });
    return () => {
        observer.disconnect();
    };
}


export const unwatch = watch();

